  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:32.364744\",\n\t\"name\": \"turnbull-early-detection-and-rapid-response-team-b3d6b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The refuge has recently purchased several
  tracts that need to be surveyed and mapped. Funding from this grant will allow for
  the purchase of biocontrol agents, chemicals and application equipment to facilitate
  the rapid response phase of the project and provide funds to hire either an AmeriCorps
  member or independent contractor through the Refugeu2019s Friendu2019s Group. 4
  volunteers were recruited and trained to conduct GPS based weed surveys. They inventoried
  and mapped 1,494 acres of the refuge. Three populations of invasive species mapped
  in previous years were revisited and monitored. One site received followup control
  efforts. The maps generated from this effort directed control efforts on 160 acres
  in 2013 and provided geographically based information for lanning control efforts
  in 2014. Channeled Scablands CWMA, a partnership group representing 10 agencies
  and local landowners, sponsored a very successful workshop on the management of
  invasive annual grasses on rangelands. The AmeriCorps member assisted this group
  with reviewing.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
